import React from "react";
import "./index.css";

const SubNavbar = () => {
  return (
    <div className="subnavbar">
      <ul className="navbar-feature">
        <li>Live</li>
        <li>Inbound</li>
        <li>Service Level</li>
        <li>Outbound</li>
        <li>Agents</li>
        <li>Numbsssssssssssssssssssssssssssssssssssssssssssssssssssers</li>
        <li>Calls</li>
        <li>Dispositions</li>
        <li>Sentiment</li>
        <li>Scheduled</li>
      </ul>
    </div>
  );
};

export default SubNavbar;
